import { engLetters } from "../models/Regex";
import { GrayButton } from "../styles/Buttons";
import { LoginBox, MainMenuBox } from "../styles/Menu";
import { ButtonText, SerifText } from "../styles/TextStyles";
import { MenuButton } from "./buttons/MenuButtonsY";
import { FormLogin } from "./forms/FormLogin";
import { InputBase } from "./Input";

export const MenuHidden = ({ isOpen }: any) => {
  return (
    <MainMenuBox theme={isOpen}>
      <MenuButton img={"orderHistory"} label={"History"} />
      <MenuButton img={"myLists"} label={"My lists"} />
      <MenuButton img={"orderHistory"} label={"Dark mode"} />
      <FormLogin />

      {/* <MenuButton img={"logout"} label={"logout"} /> */}
    </MainMenuBox>
  );
};
